import React from 'react';
import './Profile.css';

function Profile() {

  return (
    <div className='profile__wrapper'>
      <div className="profile__main">
        <div className="profile__bg"></div>
        <div className="profile__human human">
          <div className="human__left"></div>
          <div className="human__right"></div>
        </div>
      </div>
      <div className="profile__addons">

      </div>
    </div>
  );
};

export default Profile;
